import { all } from 'redux-saga/effects';
import {watch_ViewType_GET_RequestServer} from './ViewType/sagasServerViewType';
import {watch_ViewType_POST_RequestServer} from './ViewType/sagasNewDataViewType';
import { watch_ViewType_PUT_RequestServer } from './ViewType/sagasUpdateDataViewType ';



export default function* rootSaga(){
    yield all( [ 
                    watch_ViewType_GET_RequestServer(),
                    watch_ViewType_POST_RequestServer(),
                    watch_ViewType_PUT_RequestServer()


               ])
}
